import React from "react";
import Title from "./Title";
import Input from "./Input";
import Item from "./Item";


export default function Todo() {
    const todoItems =[
        {
            name:'Buy Milk',
            dueDate:'4/10/2023'
        },
        {
            name:"Go to college",
            dueDate:'4/10/2024'
        },
        {
          name:"Ghee",
          dueDate:'5/10/2024'
        },
        {
           name:"Dal",
           dueDate:'6/10/2024'
        }
    ]
  return (
    <>
      <Title heading={'Todo App'} react={'(ReactApp)'} />
      <div className="row mt-4">
         <Input/>
      </div>
      <div className="row">
        <Item todoItems={todoItems}/>
      </div>
    </>
  );
}
